import './pages/header.css'
function Menu(){
    return(
        <div className="nav">
            <nav >
              <div className="Nav1">  <Link  to={"/Inicio"}>Incio</Link> </div>
                <Link className="Nav1" to={"/Productos"}>Productos</Link>
                <Link className="Nav1" to={"/Contacto"}>Contacto</Link>
                <Link className="Nav1" to={"/Info"}>Info</Link>
                <Link className="Nav1" to={"/Usuario"}>Usuario</Link>
            </nav>
        </div>
    )
}
export default Menu;
